import {
    CREATE_PROFILE,
} from './types'

export const createProfile = (profile) => dispatch => {
    e.preventDefault();
    profile = {
        firstName,
        lastName,
        email,
        company,
        website,
        location,
        skills,
        gitHub,
        bio,
        linkedIn,
        youtube,
    };
    console.log('ddddddddddd');
    dispatch({
        type: CREATE_PROFILE,
        payload: profile
    })
}
